Quick Tip for your Monday morning (or whatever day you are viewing this 😝). I personally have a really hard time having a steady hand for piping (hence why you see very minimal piping techniques on my cakes). This allows me to know where the lines are for different colors so they are equal and straight! 
💚 When taping your toothpick you want just the point to be sticking out. 
💚 When you tape them down, rub down the side of the toothpick with the tape over it so the tape curves around the toothpick to stick well 
💚 I find it easier to scrape with the toothpick on the back side of the scraper. 
💚 This scraper with a ruler on it is from @everythingjustbaked and is very handy! Go get one! 
